import React from 'react';

const Navbar = () => {
	return (
		<nav>
			<ul>
				<li>
					<a href="./home">Home</a>
				</li>
				<li>About</li>
				<li>Login</li>
			</ul>
		</nav>
	);
}

export default Navbar;
